import React from 'react'

export default function Sinin() {
    return (
        <div className="back">
            <div className="login">
                <h2>Log in</h2>
                <form action="">
                    Email:<br /><input type="text" name="email" placeholder="input email address"/>
                    <br /><br />Password:<br /><input type="password" name="password" />
                    <br/><br/>
                    <button><h3>Log in</h3></button>
                </form>
            </div>
        </div>
    );
}
